import React from 'react'
import { Box } from '@mui/system'
import Card from './components/CardTemplate'
const box = {
  textAlign: 'left'
}

const cdm = [
  {
    title: 'Computer Engineering',
    description: 'Typically involves software and hardware and the development of systems that involve software, hardware, and communications.'
  },
  {

  },

];

const HistoryOfCS = (data) => {
  return (
    <div style={box}>
      {cdm.map(function (data) {
        return (
          <div key={data.id}>
            <li>
              <ul>
                {data.title}
              </ul>
              {data.description}
            </li>
          </div>
        )
      })}
    </div>
  )
}

export default HistoryOfCS
